import React from "react";

import Dashboard from './pages/Dashboard';

class MainPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {currentState: 'dashboard'};
  }

  render() {
    switch (this.state.currentState) {
      case 'dashboard':
        return <Dashboard />;
      case 'entermeal':
        return <EnterMeal />;
    }

    return <Dashboard />;

  }
}

export default MainPage;
